{"post_stream":{"posts":[{"id":3345115,"name":"","username":"RoboTitans9206","avatar_template":"/letter_avatar_proxy/v4/letter/r/45deac/{size}.png","created_at":"2024-03-27T12:20:22.562Z","cooked":"<p>Hi all, this is my first topic,</p>
<p>My team is having an issue with the imports for our VictorSPX motor controllers. Our line for importing VictorSPX is saying " The import com.ctre cannot be resolved." We tried uninstalling and reinstalling phoenix v5 and phoenix 6; however, we are still encountering this error. I have attached our current code to the end of this topic. Thanks all!</p>
<p>package frc.robot;</p>
<p>//import edu.wpi.first.wpilibj.<span class="abbreviation">PWM<template class="tooltiptext" data-text="Pulse Width Modulation"></template></span>;<br>
