import edu.wpi.first.wpilibj.smartdashboard.SmartDashboard;</p>
<p>//our added imports are below</p>
<p>import edu.wpi.first.wpilibj.motorcontrol.PWMSparkMax;<br>
//import com.ctre.phoenix.motorcontrol.ControlMode;<br>
//import com.ctre.phoenix.motorcontrol.NeutralMode;<br>
