import edu.wpi.first.wpilibj.drive.DifferentialDrive;<br>
import edu.wpi.first.wpilibj.Timer;<br>
import edu.wpi.first.wpilibj.XboxController;</p>
<p>/**</p>
<ul>
<li>The VM is configured to automatically run this class, and to call the functions corresponding to</li>
<li>each mode, as described in the TimedRobot documentation. If you change the name of this class or</li>
<li>the package after creating this project, you must also update the build.gradle file in the</li>
<li>project.<br>
**/<br>
public class Robot extends TimedRobot {<br>
private static final String kDefaultAuto = “Default”; //go across line only<br>
private static final String kSpeakerMiddle = “Speaker Middle and Backup”;<br>
private static final String kRedLongAuto = “Red Long Speaker and Backup”;<br>
private String m_autoSelected;<br>
private final SendableChooser m_chooser = new SendableChooser&lt;&gt;();<br>
private final XboxController driverController = new XboxController(0);<br>
private final XboxController operatorController = new XboxController(2);</li>
</ul>
<p>double driveLimit = 1;<br>
double launchPower = 0;<br>
double feedPower = 0;<br>
double hangPower = 1;<br>
double thirdPower = 1;</p>
<p>//private VictorSPX hangTopVictor = new VictorSPX(Constants.OperatorConstants.hangTopCANID);<br>
VictorSPX leftRear = new VictorSPX(7);<br>
VictorSPX leftFront = new VictorSPX(8);<br>
PWMSparkMax rightRear = new PWMSparkMax(3);<br>
PWMSparkMax rightFront = new PWMSparkMax(4);<br>
PWMSparkMax hangTopMotor = new PWMSparkMax(0);</p>
<p>//moters for shooting<br>
PWMSparkMax feedWheel = new PWMSparkMax(5);<br>
PWMSparkMax launchWheel = new PWMSparkMax(6);<br>
//private final PWMSparkMax thirdWheel = new PWMSparkMax(1);</p>
<p>private final Timer timer1 = new Timer();</p>
<p>private final Timer timer2 = new Timer();</p>
<p>DifferentialDrive myDrive = new DifferentialDrive( {</p>
<pre><code>(double output) -&gt; { 
  rightFront.set(output); 
  rightRear.set(output); 
}
</code></pre>
<p>);<br>
/**</p>
<ul>
<li>This function is run when the robot is first started up and should be used for any</li>
<li>initialization code.<br>
*/<br>
<a class="mention" href="/u/override">@Override</a><br>
public void robotInit() {<br>
m_chooser.setDefaultOption(“Default Auto”, kDefaultAuto);<br>
m_chooser.addOption(“Speaker Middle and Backup”, kSpeakerMiddle);<br>
m_chooser.addOption(“Red Long Speaker and Backup”, kRedLongAuto);<br>
SmartDashboard.putData(“Auto choices”, m_chooser);</li>
</ul>
<pre><code>rightFront.setInverted(false);
rightRear.setInverted(false); 
hangTopMotor.setInverted(true); 



feedWheel.setInverted(true);
launchWheel.setInverted(true);
//thirdWheel.setInverted(true); 


timer1.start(); 
</code></pre>
<p>}</p>
<p>/**</p>
<ul>
<li>This function is called every 20 ms, no matter the mode. Use this for items like diagnostics</li>
<li>that you want ran during disabled, autonomous, teleoperated and test.</li>
<li></li>
<li>
<p>This runs after the mode specific periodic functions, but before LiveWindow and
</p></li>
<li>SmartDashboard integrated updating.<br>
*/</li>
</ul>
<p><a class="mention" href="/u/override">@Override</a><br>
public void robotPeriodic() {}</p>
<p>/**</p>
<ul>
<li>This autonomous (along with the chooser code above) shows how to select between different</li>
<li>autonomous modes using the dashboard. The sendable chooser code works with the Java</li>
<li>SmartDashboard. If you prefer the LabVIEW Dashboard, remove all of the chooser code and</li>
<li>uncomment the getString line to get the auto name from the text box below the Gyro</li>
<li></li>
<li>
<p>You can add additional auto modes by adding additional comparisons to the switch structure
</p></li>
<li>below with additional strings. If using the SendableChooser make sure to add them to the</li>
<li>chooser code above as well.<br>
*/<br>
<a class="mention" href="/u/override">@Override</a><br>
public void autonomousInit() {<br>
m_autoSelected = m_chooser.getSelected();<br>
// m_autoSelected = SmartDashboard.getString(“Auto Selector”, kDefaultAuto);<br>
System.out.println("Auto selected: " + m_autoSelected);</li>
</ul>
<pre><code>timer1.reset(); 
</code></pre>
<p>}</p>
<p>/** This function is called periodically during autonomous. */<br>
<a class="mention" href="/u/override">@Override</a><br>
public void autonomousPeriodic() {</p>
<pre><code>switch (m_autoSelected) {
  default: // just cross the line backwards for points
    // put default auto code here
    if (timer1.get() &lt; 4.0) {
      myDrive.tankDrive(-.5, -.5);
    } else {
      myDrive.tankDrive(0, 0);
    }
    break;
  case kSpeakerMiddle: // start middle speaker launch then backup
    if (timer1.get() &lt; 3.0) {
      launchWheel.set(-1.0);
      feedWheel.set(0.0);
      //thirdWheel.set(0.0); 
      myDrive.tankDrive(0.0, 0.0);
    } else if (timer1.get() &lt; 5.0) { // turn on feed wheel to launch the note
      launchWheel.set(-1.0);
      feedWheel.set(-1.0);
      //thirdWheel.set(-1.0);
      myDrive.tankDrive(0.0, 0.0);
    } else if (timer1.get() &lt; 6.5) { // backup over the line for leave points
      launchWheel.set(0);
      feedWheel.set(0);
      //thirdWheel.set(); 
      myDrive.tankDrive(-.5, -.5);
    } else { // done turning off all motors
      launchWheel.set(0.0);
      feedWheel.set(0.0);
      //thirdWheel.set();
      myDrive.tankDrive(0, 0);
    }
    break;
  case kRedLongAuto:
    if (timer1.get() &lt; 3.0) {
      launchWheel.set(-1.0);
      feedWheel.set(0.0);
      //thirdWheel.set();
      myDrive.tankDrive(0.0, 0.0);
    } else if (timer1.get() &lt; 5.0) { // turn on feed wheel to launch the note
      launchWheel.set(-1.0);
      feedWheel.set(-1.0);
      //thirdWheel.set(); 
      myDrive.tankDrive(0.0, 0.0);
    } else if (timer1.get() &lt; 6.5) { // backup over the line for leave points
      launchWheel.set(0);
      feedWheel.set(0);
      //thirdWheel.set();
      myDrive.tankDrive(-.5, -.5);
    } else if (timer1.get() &lt; 7.5) {
      launchWheel.set(0);
      feedWheel.set(0);
      //thirdWheel.set(); 
      myDrive.tankDrive(.4, -.4);
    } else if (timer1.get() &lt; 9.5) {
      launchWheel.set(0);
      feedWheel.set(0);
      //thirdWheel.set(); 
      myDrive.tankDrive(-.5, -.5);
    } else { // done turning off all motors
      launchWheel.set(0.0);
      feedWheel.set(0.0);
      //thirdWheel.set(); 
      myDrive.tankDrive(0, 0);
    }
    break;
}
</code></pre>
<p>}</p>
<p>/** This function is called once when teleop is enabled. */<br>
<a class="mention" href="/u/override">@Override</a><br>
public void teleopInit() {}</p>
<p>/** This function is called periodically during operator control. */<br>
<a class="mention" href="/u/override">@Override</a><br>
public void teleopPeriodic() {<br>
// drive train code here<br>
if(driverController.getRightBumper() == true){<br>
driveLimit = 1;<br>
}<br>
else if(driverController.getLeftBumper() == true){<br>
driveLimit = 0.5;<br>
}<br>
myDrive.tankDrive(-driverController.getLeftY(), -driverController.getRightY());<br>
<a href="//myDrive.arcadeDrive" rel="noopener nofollow ugc">//myDrive.arcadeDrive</a>(-driverController.getLeftY()*driveLimit, -driverController.getRightX()*driveLimit);</p>
<pre><code>//hanging code here
if(operatorController.getBButtonPressed()){ 
  if(hangPower == 0){
    timer2.reset();
  }     
} 

if(timer2.get() &lt; 4.0){
  hangPower = 1.0;
}
else{ 
  if(timer2.get() &lt; 7.0){
    hangPower = -1.0; 
}
else{
  hangPower = 0;
}

//hangTopVictor.set(hangPower)

//launcher code here
if(operatorController.getLeftBumper()) {

  launchPower = -1.0; 
  feedPower = -1.0; 

}
else{
  if(operatorController.getAButtonPressed()){
    timer1.reset(); 
  }

  if(timer1.get() &lt; 1.0){ //spool up the launch wheel
    launchPower = 1.0; 
    feedPower = 0; 
  }
  else if(timer1.get() &lt; 2.0){
    launchPower = 1.0; 
    feedPower = 1.0; 
} 
else{
  launchPower = 0; 
  feedPower = 0; 
}
</code></pre>
<p>}</p>
<pre><code>launchWheel.set(launchPower); 
feedWheel.set(feedPower); 
</code></pre>
<p>}<br>
}</p>
